import { BaseStyles } from "../../../Shared";
/**
 * @class MessageReceiptStyles
 */

class MessageReceiptStyles extends BaseStyles {

    constructor({
        width,
        height,
        background,
        activeBackground,
        border,
        borderRadius
    }) {
        super({
            width,
            height,
            background,
            activeBackground,
            border,
            borderRadius
        });
    }
}
export { MessageReceiptStyles };
